import style  from './SearchBar.module.scss'
import {Button, Form} from "react-bootstrap";
import {Autocomplete, TextField} from "@mui/material";
export  const SearchBar = (props) => {
    const ipAddress = '0';
    const Key = process.env.WEATHER_API_KEY;

    const handelInputChange = (e)=>{
       const  value = e.currentTarget.value;
        const apiUrl = `https://api.geoapify.com/v1/geocode/search?text=${value}&apiKey=`;
        fetch(apiUrl)
            .then(response => response.json())
            .then(data => console.log(data));
    }
    return (
        <>
            <Form >
                <Form.Group className={`d-flex justify-content-center mt-5 gap-4` }>
                    <Form.Label>
                    <Autocomplete onInputChange={handelInputChange} className={style.searchInput} size={'lg'} renderInput={(params) =>  <TextField {...params} label={'Enter Your City '} /> } options={['casa', 'raba', 'laayoun', 'agadir']}/>
                    </Form.Label>
                    <Form.Label>
                    <Button size={'lg'}  variant={'primary'}>Search</Button>
                    </Form.Label>
                </Form.Group>
            </Form>
        </>
    );
};
